import React, { useState, useEffect } from 'react';
import './userTable.css';

const UserTable = ({ users, onDelete, onUpdate }) => {
  const [editUserId, setEditUserId] = useState(null);
  const [newName, setNewName] = useState('');
  const [newEmail, setNewEmail] = useState('');
  const [comments, setComments] = useState({});
  const [selectedUserId, setSelectedUserId] = useState(null);

  useEffect(() => {
    const fetchComments = async () => {
      try {
        const commentsData = {};
        for (const user of users) {
          const res = await fetch(`https://jsonplaceholder.typicode.com/posts/1/comments`);
          const data = await res.json();
          commentsData[user.id] = data.filter(comment => comment.email === user.email);
        }
        setComments(commentsData);
      } catch (err) {
        console.log('Error fetching comments:', err);
      }
    };

    fetchComments();
  }, [users]);

  const handleEditClick = (user) => {
    setEditUserId(user.id);
    setNewName(user.name);
    setNewEmail(user.email);
  };

  const handleUpdateClick = () => {
    if (editUserId) {
      onUpdate(editUserId, newName, newEmail);
      setEditUserId(null);
      setNewName('');
      setNewEmail('');
    }
  };

  const handleCommentsClick = (userId) => {
    setSelectedUserId(userId);
  };

  const handleCloseComments = () => {
    setSelectedUserId(null);
  };

  return (
    <div>
      <table className="user-table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Email</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {users.map((user) => (
            <tr key={user.id}>
              <td>{user.id}</td>
              <td>
                {editUserId === user.id ? (
                  <input
                    type="text"
                    value={newName}
                    onChange={(e) => setNewName(e.target.value)}
                  />
                ) : (
                  user.name
                )}
              </td>
              <td>
                {editUserId === user.id ? (
                  <input
                    type="email"
                    value={newEmail}
                    onChange={(e) => setNewEmail(e.target.value)}
                  />
                ) : (
                  user.email
                )}
              </td>
              <td>
                {editUserId === user.id ? (
                  <button className="update-btn" onClick={handleUpdateClick}>
                    Update
                  </button>
                ) : (
                  <button className="edit-btn" onClick={() => handleEditClick(user)}>
                    Edit
                  </button>
                )}
                <button className="delete-btn" onClick={() => onDelete(user.id)}>
                  Delete
                </button>
                <button className="comments-btn" onClick={() => handleCommentsClick(user.id)}>
                  Show Comments
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      {selectedUserId !== null && (
        <div className="comments-popup">
          <button className="close-btn" onClick={handleCloseComments}>
            Close
          </button>
          <h3>Comments for {users.find(user => user.id === selectedUserId)?.name}</h3>
          <div className="comments-container">
            {comments[selectedUserId] && comments[selectedUserId].map((comment) => (
              <div key={comment.id} className="comment-box">
                {comment.body}
              </div>
            ))}
          </div>
        </div>
      )}
    </div>
  );
};

export default UserTable;
